El poema es un soneto del poeta español José Selgas Carrasco (1822-1882), escritor murciano del Romanticismo español que destacó tanto en la poesía como en la prosa. Fue miembro de la Real Academia Española y es conocido por sus obras líricas de carácter costumbrista y sentimental.
